import { StyleSheet } from "react-native"

export const styles = StyleSheet.create({
  container: {
    alignItems: "center",
    backgroundColor: "#FFF",
    borderColor: "#e5e5e5",
    borderRadius: 11,
    borderWidth: 1,
    flexDirection: "row",
    justifyContent: "space-between",
    paddingVertical: 13,
    paddingHorizontal: 21,
    shadowColor: "#0d0000",
    shadowRadius: 20,
  }
});



export default styles;
